import React, { useState } from 'react';
import PersonalInfo from './components/Address';
import Address from './components/';
import EducationalInfo from './EducationalInfo';

const App = () => {
  const [personalInfo, setPersonalInfo] = useState(null);
  const [addressInfo, setAddressInfo] = useState(null);
  const [educationalInfo, setEducationalInfo] = useState(null);

  const handlePersonalInfoSubmit = (data) => {
    setPersonalInfo(data);
  };

  const handleAddressSubmit = (data) => {
    setAddressInfo(data);
  };

  const handleEducationalInfoSubmit = (data) => {
    setEducationalInfo(data);
  };

  return (
    <div className="App">
      <h1>Student Information Form</h1>

      <PersonalInfo onSubmit={handlePersonalInfoSubmit} />
      {personalInfo && (
        <div>
          <h2>Personal Information Summary</h2>
          <pre>{JSON.stringify(personalInfo, null, 2)}</pre>
        </div>
      )}

      <Address onSubmit={handleAddressSubmit} />
      {addressInfo && (
        <div>
          <h2>Address Information Summary</h2>
          <pre>{JSON.stringify(addressInfo, null, 2)}</pre>
        </div>
      )}

      <EducationalInfo onSubmit={handleEducationalInfoSubmit} />
      {educationalInfo && (
        <div>
          <h2>Educational Information Summary</h2>
          <pre>{JSON.stringify(educationalInfo, null, 2)}</pre>
        </div>
      )}
    </div>
  );
};

export default App;
